import React from 'react';
import { Route, Routes } from 'react-router-dom';
import { useRouteMatch } from 'react-router';
import PomodoroTimer from './PomodoroTimer';
import StatsComponent from './StatsComponent';
import SettingsComponent from './SettingsComponent';

function MainPage() {
    let match = useRouteMatch();

    return (
        <div>
            <Routes>
                <Route path={`${match.path}/timer`} element={<PomodoroTimer />} />
                {/* Temporarily setting totalPomodoros to 0 until data is fetched. */}
                <Route path={`${match.path}/stats`} element={<StatsComponent totalPomodoros={0} />} />
                <Route path={`${match.path}/settings`} element={<SettingsComponent />} />
                {/* ... Add other Routes if needed ... */}
            </Routes>
        </div>
    );
}

export default MainPage;
